                                    <p>This dataset classifies people described by a set of attributes as good or bad credit risks. Using classification techniques, build a model to predict good or bad customers to help the bank decide on granting loans to its customers</p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-13">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-13" aria-expanded="false" aria-controls="collapse-curriculum-13"> <span class="left">3</span> <span class="right">Machine Learning : Unsupervised Learning</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-13" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-curriculum-13">
                                <div class="panel-body editor-content">
                                    <p><b>Learning Objectives:</b> </p>
                                    <p>Learn about unsupervised learning technique - K-Means Clustering and Hierarchical Clustering. Also understand the Elbow method and Silhouette method.<br><b><br></b><b>Topics Covered:</b></p>
                                    <ul>
                                        <li>K-means Clustering</li>
                                        <li>Hierarchical Clustering</li>
                                        <li>High-dimensional Clustering</li>
                                        <li>Case Study</li>
                                    </ul>
                                    <p><span style=""><b>Hands-on:</b></span></p>
                                    <p>In marketing, if you’re trying to talk to everybody, you’re not reaching anybody.. This dataset has social posts of teen students. Based on this data, use K-Means clustering to group teen students into segments for targeted marketing campaigns.<span style=""></span></p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-14">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-14" aria-expanded="false" aria-controls="collapse-curriculum-14"> <span class="left">4</span> <span class="right">Machine Learning : Ensemble Techniques</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-14" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-curriculum-14">
                                <div class="panel-body editor-content">
                                    <p><span style=""><b>Learning Objectives:</b></span></p>
                                    <p>Learn about bootstrap sampling and its advantages followed by bagging. Boost model performance with Boosting. Through a real-life case study, learn Random Forest and how it helps avoid overfitting compared to decision trees. <span style=""></span><br><b><br></b><b>Topics Covered:</b></p>
                                    <ul>
                                        <li>Boosting<br></li>
                                        <li>Bagging</li>
                                        <li>Random Forest</li>
                                        <li>Case Study</li>
                                    </ul>
                                    <p><b>Hands-on:</b> </p>
                                    <p>In statistics and machine learning, ensemble methods use multiple learning algorithms to obtain better predictive performance than could be obtained from any of the constituent learning algorithms alone. In this case study, use AdaBoost, GBM &amp; Random Forest on Lending Data to predict loan status. Ensemble the output and see your result perform better than a single model.<br></p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-15">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-15" aria-expanded="false" aria-controls="collapse-curriculum-15"> <span class="left">5</span> <span class="right">Machine Learning : Reinforcement Learning</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-15" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-curriculum-15">
                                <div class="panel-body editor-content">
                                    <p><b>Learning Objectives:</b> </p>
                                    <p>Understand the basics of RL and its applications in AI. Get an understanding of Markov Decision Processes: Model processes as Markov chains, and learn algorithms for solving optimisation problems. Write Q-learning algorithms to solve complex RL problems.</p>
                                    <p><b>Topics Covered:</b></p>
                                    <ul>
                                        <li>Value based methods&nbsp;</li>
                                        <li>Q-learning</li>
                                        <li>Policy-based methods</li>
                                    </ul>
                                    <p><b>Hands-on: </b>No hands-on<br></p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-16">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-16" aria-expanded="false" aria-controls="collapse-curriculum-16"> <span class="left">6</span> <span class="right">Deep Learning</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-16" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-curriculum-16">
                                <div class="panel-body editor-content">
                                    <p><b>Learning Objectives:</b> </p>
                                    <p>Learn advanced machine learning techniques using the Neural Networks algorithms. Neural Networks can enable pattern recognition based on a large amount of inputs. Learn how NN algorithms work, and end up with an introduction to deep learning.</p>
                                    <p>This module covers various activation functions like sigmoid, hyperbolic-tangent, Rectified Linear Units, Leaky Rectified Linear Units.<br></p>
                                    <p><b>Topics Covered:</b></p>
                                    <ul>
                                        <li>Neural Network Basics</li>
                                        <li>Deep Neural Networks</li>
                                        <li>TensorFlow using Neural Networks &amp; Deep Learning</li>
                                        <li>Case Study</li>
                                    </ul>
                                    <p><b>Hands-on:</b> </p>
                                    <p>A research study was aimed at the case of customers’ default payments in Taiwan. From the perspective of risk management, the result of predictive accuracy of the estimated probability of default will be more valuable than the binary result of classification - credible or not credible clients.</p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-17">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-17" aria-expanded="false" aria-controls="collapse-curriculum-17"> <span class="left">7</span> <span class="right">Natural Language Processing</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-17" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-curriculum-17">
                                <div class="panel-body editor-content">
                                    <p><b>Learning Objectives:</b> </p>
                                    <p>Get started with the Natural language toolkit, and learn the basics of text processing in Python. Learn how to extract features from unstructured text and build machine learning models on text data. Conduct sentiment analysis, learn to parse English sentences and extract meaning from them. Explore the applications of text analytics in new areas and various business domains.<br><br><b>Topics Covered:</b><u><b></b></u></p>
                                    <ul>
                                        <li>Statistical NLP and text similarity</li>
                                        <li>Text Summarization</li>
                                        <li>Syntax and Parsing techniques</li>
                                        <li>Semantics and Generation</li>
                                        <li>Case Study</li>
                                    </ul>
                                    <p><b>Hands-on:</b> </p>
                                    <p>Stock market prediction has been an interesting research topic for many years. Finding an efficient and effective means of studying the market perceptions found its way in different social networking platforms such as Twitter. With proper tools and the help of technology, meaningful and precious information can be gathered, analyzed, and utilized in different areas like in the movement and performance of the stock market.</p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-18">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-18" aria-expanded="false" aria-controls="collapse-curriculum-18"> <span class="left">8</span> <span class="right">Computer Vision</span> </a> </h4>
                            </div>
                            <div id="collapse-curriculum-18" class="panel-collapse collapse" role="tabpanel" aria-labelledby="heading-curriculum-18">
                                <div class="panel-body editor-content">
                                    <p><b>Learning Objectives:</b> </p>
                                    <p>Learn to use the power of computer vision and play with what you see, detect faces, eyes and other attributes using Haar cascades.<br><br><b>Topics Covered:</b><b></b></p>
                                    <ul>
                                        <li>Convolutional Neural Networks</li>
                                        <li>Keras Library for Deep Learning in Python</li>
                                        <li>Pre-processing Image Data</li>
                                        <li>Object and face recognition using OpenCV</li>
                                        <li>Case Study</li>
                                    </ul>
                                    <p><b>Hands-on: </b></p>
                                    <p>While we drive on a highway, we tend to feel sleepy. In this project, using OpenCV and implementing object detection and feature extraction we detect fatigue in real-time and report an alarm which will not only keep a driver attentive while driving but also reduce the number of accidents.</p>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="heading-curriculum-19">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".accordion" href="#collapse-curriculum-19" aria-expanded="false" aria-controls="collapse-curriculum-19"> <span class="left">9</span> <span class="right">Intelligent Agents</span> </a> </h4>
                            </div>
