                                <div class="panel-body editor-content">
                                    <p><b>Learning Objectives:</b> </p>
                                    <p>Learn the AI search technique that employs heuristic for its moves. Understand the fundamental concepts of genetic algorithms and visualize the evolution.<br><br><b>Topics Covered:</b><b></b></p>
                                    <ul>
                                        <li>Uniform and heuristic-based search techniques</li>
                                        <li>Planning and constraint satisfaction techniques</li>
                                        <li>Adversarial search and its uses</li>
                                        <li>Case Study</li>
                                    </ul>
                                    <p><b>Hands-on:</b> </p>
                                    <p>Use cutting edge AI techniques to teach a computer to play a computer game.</p>
